import React from 'react';
import Card from '../Card';
import Carousel from 'react-elastic-carousel';

import './style.css';

export default function SectionOurStory() {
    return (
        <section className="OurStory">

            <div className="text-story">
                <h1>Nossa <span>história</span></h1>
            </div>

            <h2 className="years">2017</h2>

            <div className="sliderStory">
                <Carousel>
                    <Card textarea='Março: Nascemos com um cartão de crédito totalmente digital, com Cashback, Cartão Virtual, opção de saques e muitos outros benefícios.'/>
                    <Card />
                    <Card />
                    <Card />
                </Carousel>
            </div>
        </section>
    )
}
